import React from "react";

const Table = ({data}) =>{
return(
    <table>
        <tbody>
            <tr>
                <th></th>
                <th></th>
            </tr>
            {data.map((item)=>(
            <tr key={item.id}>
                <td>{item.name}</td>
                <td>{item.img}</td>
            </tr>
            ))}
        </tbody>
    </table>
)
}

export default Table;
